var mapLinks = document.querySelectorAll('.map-link');

for (var i = 0; i < mapLinks.length; i++) {
  mapLinks[i].addEventListener('mouseover', function() {
    var address = this.getAttribute('data-map');
    var linkPosition = this.getBoundingClientRect();
    var mapContainer = document.createElement('div');
    mapContainer.classList.add('map-container');
    mapContainer.style.left = linkPosition.left + 'px';
    mapContainer.style.top = linkPosition.bottom + 'px';
    mapContainer.innerHTML = '<iframe width="100%" height="100%" frameborder="0" style="border:0" src="https://yandex.ru/maps/?text=' + encodeURIComponent(address) + '&lang=ru_RU"></iframe>';
    document.body.appendChild(mapContainer);

    mapContainer.addEventListener('mouseleave', function() {
      mapContainer.parentNode.removeChild(mapContainer);
    });
  });
}








